static void
bala_traverse_visitor_instance_init (BalaTraverseVisitor * self,
                                     gpointer klass)
{
	self->priv = bala_traverse_visitor_get_instance_private (self);
}

static void
bala_traverse_visitor_finalize (BalaCodeVisitor * obj)
{
	BalaTraverseVisitor * self;
	self = G_TYPE_CHECK_INSTANCE_CAST (obj, BALA_TYPE_TRAVERSE_VISITOR, BalaTraverseVisitor);
	(self->priv->func_target_destroy_notify == NULL) ? NULL : (self->priv->func_target_destroy_notify (self->priv->func_target), NULL);
	self->priv->func = NULL;
	self->priv->func_target = NULL;
	self->priv->func_target_destroy_notify = NULL;
	BALA_CODE_VISITOR_CLASS (bala_traverse_visitor_parent_class)->finalize (obj);
}

